import React from 'react';
import logo from './logo.svg';
import './App.css';
import {BrowserRouter as Router, Route, Link} from 'react-router-dom';
import Home from './components/Home';
import Crypto from './components/Crypto';
import {Navbar, Jumbotron} from 'react-bootstrap';
import AllergenNav from './components/AllergenNav';
import Allergen from './components/Allergen';
import Title from './components/Title';
import {Copy} from './components/Title';
import './genX.css';


function App() {
  return (
    <Router>
      <link
        rel="stylesheet"
        href="https://maxcdn.bootstrapcdn.com/bootstrap/4.3.1/css/bootstrap.min.css"
        integrity="sha384-ggOyR0iXCbMQv3Xipma34MD+dH/1fQ784/j6cY/iJTQUOhcWr7x9JvoRxT2MZw1T"
        crossorigin="anonymous"
      />
      <div className="App">
      <Navbar>
        <ul>
          <li>
            <Link default>Home Page</Link>
          </li>
          <li>
            <Link to='/crypto'>Stellar</Link>
          </li>
          <li>
            <Link to='/allergen'>Allergen Reader</Link>
          </li>
        </ul>
      </Navbar>
      <AllergenNav/>
      <header className="box">
          <Title text="Allergen Check" />
          <Copy />
      </header>
      <Jumbotron>
        <Route default component={Home}/>
        <Route path="/crypto" component={Crypto} />
        <Route path='/allergen' component={Allergen} />
      </Jumbotron>
      </div>
    </Router>
  );
}

export default App;
